(ns aoc2018.d05-test
  (:require [aoc2018.d05 :refer [solve-1 solve-2]]
            [clojure.test :refer [deftest is testing]]))


(def input "")


(def example "dabAcCaCBAcCcaDA")


(deftest part-1
  (testing "example"
    (is (= 10 (solve-1 example))))

  (testing "input"
    (is (= 9154 (solve-1 input)))))


(deftest part-2
  (testing "example"
    (is (= 4 (solve-2 example))))

  (comment
    (testing "input"
      (is (= 4556 (solve-2 input))))))
